import {
	Row,
	Card,
	Input,
	Modal,
	Button,
	Image,
	Space,
	Typography
} from 'antd'
import { FC, useState } from 'react'
import { COLORS, SIZES, STYLES } from '../constants/theme'
import { WrapContainer } from './ui/WrapContainer'

export const SearchViolation: FC = () => {
	const { Search } = Input
	const { Text } = Typography

	const [isViolationAvailable, setViolationIsAvailable] =
		useState(false)
	const [carNumber, setCarNumber] = useState('')
	const [violationNumber, setViolationNumber] = useState('')

	const [isModalVisible, setIsModalVisible] = useState(false)

	const handleOk = () => {
		setIsModalVisible(false)
	}

	return (
		<Row
			justify='center'
			style={{
				marginTop: SIZES.marginVertical
			}}
		>
			<Card
				title='Перевірити наявність правопорушень'
				bordered={true}
				style={{
					boxShadow: STYLES.boxShadow,
					margin: SIZES.margin,
					backgroundColor: COLORS.containerBG
				}}
			>
				<Row justify='center'>
					<p>
						Введіть номер, щоб перевірити інформацію про штрафи, або
						з’ясувати чи ваша машина на штрафмайданчику
					</p>
				</Row>

				<Row justify='center' style={{ marginTop: SIZES.margin }}>
					{!isViolationAvailable ? (
						<Search
							addonBefore='ДНЗ'
							placeholder='номерний знак'
							allowClear
							onSearch={() => setViolationIsAvailable(true)}
							style={{ maxWidth: 304 }}
							value={carNumber}
							onChange={e => setCarNumber(e.target.value)}
							required={true}
						/>
					) : (
						<Search
							addonBefore='ЛВ'
							placeholder='номер повідомлення'
							type='number'
							allowClear
							value={violationNumber}
							style={{ maxWidth: 304 }}
							onChange={e => setViolationNumber(e.target.value)}
							onSearch={() => setIsModalVisible(true)}
						/>
					)}
				</Row>
			</Card>
			<Modal
				title='Інформація про порушення'
				visible={isModalVisible}
				onCancel={handleOk}
				width={'90%'}
				centered
				footer={[
					<Button key='back' onClick={handleOk}>
						Закрити
					</Button>
				]}
			>
				<WrapContainer>
					<Space direction='vertical'>
						<Text>
							Дата порушення:
							<Text type='secondary'>12.03.2022 10:22</Text>
						</Text>
						<Text>
							Марка: <Text type='secondary'>Audi</Text>
						</Text>
						<Text>
							Модель: <Text type='secondary'>A6</Text>
						</Text>
						<Text>
							Номерний знак: <Text type='secondary'>BC0000AM</Text>
						</Text>
						<Text>
							Адреса:
							<Text type='secondary'>м. Львів, пр. Свободи 20</Text>
						</Text>
					</Space>
				</WrapContainer>

				<Row justify='space-around' align='middle'>
					<Image.PreviewGroup>
						<Image
							width={200}
							src='data:image/jpeg;base64,'
						/>
						<Image
							width={200}
							src='data:image/jpeg;base64,'
						/>

						<Image
							width={200}
							src='data:image/jpeg;base64,'
						/>
						<Image
							width={200}
							src='data:image/jpeg;base64,'
						/>
					</Image.PreviewGroup>
				</Row>
			</Modal>
		</Row>
	)
}
